<p>–£–∫—Ä–∞—ó–Ω—Å—å–∫–µ —ñ–Ω—Ç–µ—Ä–Ω–µ—Ç-–ø—Ä–æ—Å—Ç—ñ—Ä –∑–∞–ø–æ–≤–Ω–µ–Ω–∏–π —Ä—ñ–∑–Ω–∏–º–∏ –º–∞–π–¥–∞–Ω—á–∏–∫–∞–º–∏ –¥–ª—è –∑–Ω–∞–π–æ–º—Å—Ç–≤. –°–µ—Ä–µ–¥ –Ω–∏—Ö —î —è–∫ —Ä–æ—Å—ñ–π—Å—å–∫–æ–º–æ–≤–Ω—ñ, —Ç–∞–∫ —ñ —Ü—ñ–ª–∫–æ–º –∞–Ω–≥–ª–æ–º–æ–≤–Ω—ñ. –ù–∞ –±—ñ–ª—å—à–æ—Å—Ç—ñ —Å–∞–π—Ç—ñ–≤ –±–∞–≥–∞—Ç–æ —Ñ—É–Ω–∫—Ü—ñ–π –ø–ª–∞—Ç–Ω—ñ: –ø–æ—Ç—Ä—ñ–±–Ω–æ –∫—É–ø–∏—Ç–∏ –ø—Ä–µ–º—ñ—É–º-–∞–∫–∫–∞—É–Ω—Ç, —â–æ–± –ø–∏—Å–∞—Ç–∏ –±—ñ–ª—å—à—ñ–π –∫—ñ–ª—å–∫–æ—Å—Ç—ñ –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á—ñ–≤ –∞–±–æ –∑–º–µ–Ω—à–∏—Ç–∏ –∫—ñ–ª—å–∫—ñ—Å—Ç—å —Ä–µ–∫–ª–∞–º–∏.</p>
