	<p>–£ –Ω–∞—Å —î —Å—Ç–∞—Ç–∏—Å—Ç–∏–∫–∞, –¥–µ –º–∏ –≤—ñ–¥–∑–Ω–∞—á–∞—î–º–æ, —Å–∫—ñ–ª—å–∫–∏ –ª—é–¥–µ–π —â–æ–¥–Ω—è —Ä–µ—î—Å—Ç—Ä—É—î—Ç—å—Å—è —ñ –∑–Ω–∞–π–æ–º–∏—Ç—å—Å—è —á–µ—Ä–µ–∑ —Å–∞–π—Ç. –û—Å—Ç–∞–Ω–Ω—ñ –¥–∞–Ω—ñ —Ç–∞–∫—ñ: —Ä–µ—î—Å—Ç—Ä–∞—Ü—ñ–π - –∑–∞ –¥–µ–Ω—å; –æ–±–º—ñ–Ω—ñ–≤ –ø—Ä–æ–ø–æ–∑–∏—Ü—ñ—è–º–∏ –¥—Ä—É–∂–±–∏ - –∑–∞ –¥–µ–Ω—å. –¶—ñ –ø–æ–∫–∞–∑–Ω–∏–∫–∏ –º–æ–≥–ª–∏ –± –±—É—Ç–∏ –≤–∏—â–µ, –∞–ª–µ –±–∞–≥–∞—Ç–æ –ª—é–¥–µ–π —Å–æ—Ä–æ–º–ª—è—Ç—å—Å—è –ø–∏—Å–∞—Ç–∏ –ø–µ—Ä—à–∏–º–∏ —ñ –∫–ª–∞—Ü–∞—é—Ç—å –Ω–∞ ¬´—Å–µ—Ä–¥–µ—á–∫–æ¬ª –≤ –∫—É—Ç–∫—É –∞–Ω–∫–µ—Ç–∏, –¥–æ–¥–∞—é—á–∏ –∫–æ—Ä–∏—Å—Ç—É–≤–∞—á–∞ –≤ ¬´–≤–∏–±—Ä–∞–Ω–µ¬ª. –©–æ–± —è–∫–æ–º–æ–≥–∞ —à–≤–∏–¥—à–µ –∑–Ω–∞–π—Ç–∏ –ø—ñ–¥—Ö–æ–¥—è—â—É –¥—ñ–≤—á–∏–Ω—É –∞–±–æ —Ö–ª–æ–ø—Ü—è –∞–±–æ –∑–∞—Ü—ñ–∫–∞–≤–∏—Ç–∏ –∫–æ–≥–æ-–Ω–µ–±—É–¥—å - –∑–∞–ø–æ–≤–Ω—ñ—Ç—å —Å–≤–æ—é –∞–Ω–∫–µ—Ç—É —è–∫–æ–º–æ–≥–∞ –¥–æ–∫–ª–∞–¥–Ω—ñ—à–µ.</p>
